import { render } from "react-dom";
import styles from './Symptoms.module.css'

class Symptoms extends React.Component {

    constructor(props) {
        super(props);

        this.state = {
            symptomList : [
                "Sore Throat.",
                "Fatigue.",
                "Hungry for pizza.",
                "Tired of being home.",
                "Body aches.",
                "Empty Wallet.",
                "Sleepy",
                "TBD symptom",
                "Face mask tan",
                "Long hair or mullet",
                "Feeling hot outside"
            ],
            index: 0
        }
       
    }
  
    componentDidMount() {
     this.myTimer();
    }

    myTimer = () => {
        setTimeout(
            function() {
                this.setState({index: this.state.index + 1});
                console.log("after increase")
                this.myTimer();
            }.bind(this), 5000)
    }





render() {

    return (
        <div className={styles.sympComponent}>

            <p className={styles.title}>New Side Effects Include..</p>

            <div>{this.state.symptomList[this.state.index]}</div>

        </div>
    )

}


}

export default Symptoms;
